        justifyContent: 'center',
        textAlign: 'center',
        marginBottom: '100px',
    }

    return ( 
        <section style={hero}>
            <div style={mainTitleHero}>
                <h1 className="fs-display" style={{color: '#490826', maxWidth: '810px'}}>Bring your token <span style={{color: 'var(--accent-pink)'}}>to the moon</span> with the perfect Shiller.</h1>
            </div>
        </section>
    );
}

export default LandingPage;
